"use strict";(self.webpackChunkdocs_fintesk_com=self.webpackChunkdocs_fintesk_com||[]).push([[4484],{15683:t=>{t.exports=JSON.parse('{"tag":{"label":"Importing data","permalink":"/tags/importing-data","allTagsPath":"/tags","count":11,"items":[{"id":"kb/importing-data/changing-the-field-type-of-a-custom-field","title":"Changing the field type of a custom field","description":"The best way to change a custom field type is to recreate the field in the type that you want and use the Fintesk \\"System ID\\" feature to transfer the existing data into the new field.","permalink":"/kb/importing-data/changing-the-field-type-of-a-custom-field"},{"id":"kb/importing-data/how-can-i-format-dates-to-import-into-fintesk","title":"How can I format dates to import into Fintesk?","description":"Fintesk supports multiple date formats and configurations. When importing your own dates into any date\\\\-specific field, there are a few things to take into consideration:","permalink":"/kb/importing-data/how-can-i-format-dates-to-import-into-fintesk"},{"id":"kb/importing-data/import-fields","title":"Import fields","description":"When you\u2019re importing spreadsheets into Fintesk, it\u2019s important to know which fields are available for you to move your spreadsheet data into.","permalink":"/kb/importing-data/import-fields"},{"id":"kb/importing-data/importing-data-into-fintesk-with-spreadsheets","title":"Importing data into Fintesk with spreadsheets","description":"You can import your data to Fintesk from XLS, XLSX and CSV spreadsheet files, allowing you to add deals, organizations, persons, products, notes and activities all at the same time.","permalink":"/kb/importing-data/importing-data-into-fintesk-with-spreadsheets"},{"id":"kb/importing-data/importing-advanced-mapping","title":"Importing-> advanced mapping","description":"When importing in Fintesk, some fields can be trickier to map to your spreadsheet depending on how the fields are set up. Multiple option, address and phone type fields all require an extra step in order for them to be mapped correctly.","permalink":"/kb/importing-data/importing-advanced-mapping"},{"id":"kb/importing-data/importing-mandatory-fields","title":"Importing-> mandatory fields","description":"When importing data to Fintesk from a spreadsheet, it\'s important to include the fields that are mandatory for each item to be imported successfully. This article takes you through which fields are mandatory for importing.","permalink":"/kb/importing-data/importing-mandatory-fields"},{"id":"kb/importing-data/importing-mapping-your-fields","title":"Importing-> mapping your fields","description":"In order for you to import your data to Fintesk correctly, you will need to map your spreadsheet columns to fields in Fintesk. This way you can make sure that your contact persons, organizations, deals, activities, notes, or products are all imported correctly with their relevant data.","permalink":"/kb/importing-data/importing-mapping-your-fields"},{"id":"kb/importing-data/importing-sample-import-spreadsheets","title":"Importing-> sample import spreadsheets","description":"If you need assistance with your Fintesk data import, you may wish to begin with a template document to see how best to proceed.","permalink":"/kb/importing-data/importing-sample-import-spreadsheets"},{"id":"kb/importing-data/transferring-data-to-a-different-fintesk-company-account","title":"Transferring data to a different Fintesk company account","description":"Importing and exporting your data","permalink":"/kb/importing-data/transferring-data-to-a-different-fintesk-company-account"},{"id":"kb/importing-data/updating-fintesk-data-with-a-spreadsheet","title":"Updating Fintesk data with a spreadsheet","description":"Having a large database of deals, persons, or any other item can be natural when managing your sales. However, it can be expected that some information becomes outdated over time. Updating each one of them manually is doable, but if there is a lot of information that needs to be updated, it may require important time and effort that you could be using to close deals.","permalink":"/kb/importing-data/updating-fintesk-data-with-a-spreadsheet"},{"id":"kb/importing-data/why-do-my-imported-currency-values-appear-as-0","title":"Why do my imported currency values appear as \\"0\\"?","description":"When importing from spreadsheets, make sure all monetary values (for default fields such as deal value, and for any custom fields where you have currencies) are formatted as numbers without currency symbols (so as 1000000000 as opposed to $1000000000).","permalink":"/kb/importing-data/why-do-my-imported-currency-values-appear-as-0"}],"unlisted":false}}')}}]);